CREATE DEFINER=`root`@`localhost` FUNCTION `CalculaImpNom`(`Factor` REAL, `SueldoM` DECIMAL(17,6), `TopeMax` DECIMAL(11,6), `TopeMin` DECIMAL(13,6), `Del` DATE, `Inicio` DATE, `Clave` CHAR(10), `CvePersonal` VARCHAR(11)) RETURNS decimal(17,6)
    NO SQL
BEGIN
  DECLARE DiasDescontar int;
  DECLARE Importe decimal(17,6);
  
/* Verifica que el empleado esté excento */  
IF (SELECT Count(*) FROM ExcentosDedApo WHERE ExcentosDedApo.CvePersonal=CvePersonal AND ExcentosDedApo.Clave=Clave)>0
THEN
  RETURN 0;
END IF;

/* Obtiene los días a descontar cuando no es un período completo */
IF CAST(Del AS int)- CAST(Inicio AS int)<0
THEN 
SET DiasDescontar=CAST(Del AS int)-CAST(Inicio AS int);
ELSE 
	SET DiasDescontar = 0;
END IF;

/* Obtiene el importe */
SET Importe=Factor*SueldoM*(15.2+DiasDescontar)/15.2;

IF Importe<TopeMin
THEN 
  RETURN TopeMin;
END IF;

IF Importe>TopeMax
THEN
  RETURN TopeMax;
END IF;

RETURN Importe;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
