DECLARE indicador VARCHAR(50);

SET indicador = (SELECT COUNT(*) from DetNomina WHERE DetNomina.CvePersonal=CvePersonal and DetNomina.CveNomina=CveNomina AND Clave=0325);

IF indicador=0
THEN SET subsidio = 0;
