IF indicador=1
THEN SET subsidio = (SELECT Importe FROM DetNomina WHERE DetNomina.CvePersonal=CvePersonal AND DetNomina.CveNomina=CveNomina AND Clave=0325);
END IF;

RETURN subsidio;

END ;;
