CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GeneraClavesPerDedApo`()
    NO SQL
BEGIN
INSERT INTO tmpDetNomina (CveNomina,CvePersonal,CvePer,ImpPer,Del,Al,Mes)
SELECT tmpDetNomina.CveNomina, tmpDetNomina.CvePersonal, PerDedApo.Clave, 
CalculaImpNom(PerDedApo.Factor,SUM(tmpDetNomina.ImpPer*2),PerDedApo.TopMax,PerDedApo.TopMin, tmpDetNomina.Del,tmpDetNomina.Del,PerDedApo.Clave,tmpDetNomina.CvePersonal) AS ImpPer,
tmpDetNomina.Del, tmpDetNomina.Al, 0 AS Mes
FROM PerDedApo
CROSS JOIN tmpDetNomina
WHERE PerDedApo.Activo=1
GROUP BY tmpDetNomina.CveNomina, tmpDetNomina.CvePersonal, PerDedApo.Clave, tmpDetNomina.Del, tmpDetNomina.Al;
END ;;
DELIMITER ;
