CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GeneraEventuales`(IN `CveNomina` VARCHAR(16), IN `Del` DATE, IN `Al` DATE, IN `GenHon` BIT)
    NO SQL
BEGIN
/*Declaracion de variables*/
DECLARE TotSinCta int;

/*Genera el Encabezado de la Nómina*/
INSERT INTO Nominas (CveNomina, Nombre, FecPago, Del, Al, Cheque) VALUES (CveNomina, CONCAT('NOMINA QUINCENAL ',CveNomina),Al, Del, Al, 'No');

/*Borra los registros de tmpDetNomina*/
DELETE FROM tmpDetNomina;

/*Insertando en tmpDetNomina unicamente los sueldos eventuales (0202)*/
INSERT INTO tmpDetNomina (CveNomina,CvePersonal,CvePer,ImpPer,Del,Al,Mes)
SELECT CveNomina AS CveNomina, EmpCont.CvePersonal, Clave,CalculaImpNom(Factor,(EmpCont.CostoHra*EmpCont.HrsMen),TopMax,TopMin, Del,EmpCont.Inicio,Clave,EmpCont.CvePersonal) AS ImpPer, CASE WHEN EmpCont.Inicio>Del THEN EmpCont.Inicio ELSE Del END as Del, Al AS Al, EmpCont.HrsMen
FROM EmpCont 
INNER JOIN Contratos ON EmpCont.CveContrato = Contratos.CveContrato
CROSS JOIN PerDedApo
WHERE Al BETWEEN EmpCont.Inicio and EmpCont.UltDia
AND EmpCont.TipoEmpleado=0 AND EmpCont.Retenido=0 AND PerDedApo.Clave='0202';
END ;;
DELIMITER ;
